import { BrowserRouter } from "react-router-dom";
import { Route, Switch } from "react-router-dom";
import { Lottery } from "./pages/lottery";
import { Rank } from "./pages/rank";

export const Router = () => {
    return (
        <BrowserRouter>
        <Switch>
            <Route path="/" exact> 
                <Lottery />
            </Route>

            <Route path="/rank" exact> 
                <Rank />
            </Route>
        </Switch>
        </BrowserRouter>
    );
}
